def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)
    for i in range(len(bins)):
        if item <= bins[i]/4:
            priorities[i] = np.power(item / bins[i], 1.5) + np.log1p(item / bins[i])
        elif item > bins[i]/4 and item <= bins[i]/2:
            priorities[i] = np.power(item / bins[i], 1.2) + np.log2(item / bins[i])
        elif item > bins[i]/2 and item <= bins[i]:
            if item % 2 == 0:
                priorities[i] = 1.5*(item + 2) / bins[i]
            else:
                priorities[i] = 2*(item + 4) / bins[i]
        else:
            if item % 3 == 0:
                priorities[i] = np.log1p(item / bins[i]) + np.square(item / bins[i])
            elif item % 3 == 1:
                priorities[i] = 1.5*np.log(item / bins[i]) + np.cbrt(item / bins[i])
            else:
                priorities[i] = np.sqrt(item / bins[i]) + np.exp(item / bins[i])

    return priorities
